import React, { useState } from "react";
import "../src/css/sup.css";
function Signup() {
  const [nu, setnu] = useState(true);
  const [sh, setsh] = useState(false);
  const [sb, setsb] = useState(false);
  const show = () => {
    setsh(true);
    setsb(false);
  };
  const hide = () => {
    setsh(false);
    setsb(true);
  };
  return (
    <div className="smain">
      {nu ? (
        <div className="nbody">
          <div id="cup">CREATE YOUR USERNAME AND PASSWORD</div>
          <input
            className="upsm"
            type="text"
            placeholder="ENTER YOUR USERNAME"
          />
          <br />
          <input
            className="upsm"
            type={sh ? "text" : "password"}
            placeholder="ENTER YOUR PASSWORD"
          />
          {sb ? (
            <button id="sp" onClick={show}></button>
          ) : (
            <button id="hp" onClick={hide}></button>
          )}
          <br />
          <button className="upsm">SUBMIT</button>
          <div className="upsm" id="mess">
            mess
          </div>
        </div>
      ) : (
        <div className="sbody">
          <input className="usm" type="text" placeholder="ENTER THE USER ID" />
          <button className="usm">SUBMIT</button>
          <div className="usm" id="mss">
            message
          </div>
        </div>
      )}
    </div>
  );
}
export default Signup;
